import React from 'react'

const Outbutton = () =>{
    const butstyle = {
        marginLeft:'45%',
        padding:'0.5em',
        width:'5%',
        fontSize:'100%'

    };
    return(

        <div >
            <button style={butstyle}>Shorten</button>
        </div>
    );
}

export default Outbutton;
